oxy_webhelp_navlinks = {"rcv_workloads_protection-d22908e7218":{"topics":[{"title":"RCV data protection using SLA Domain","shortdesc":"<p class=\"shortdesc\">You can configure a Rubrik Cloud Vault location as the archival or backup destination         of an SLA Domain.<\/p>","href":"saas\/rcv_data_protection_sla_domain.html","attributes":{"data-id":"rcv_data_protection_sla_domain"},"menu":{"hasChildren":false},"tocID":"rcv_data_protection_sla_domain-d22908e7229","topics":[]},{"title":"Data recovery from RCV locations","shortdesc":"<p class=\"shortdesc\">You can recover your data from the Rubrik Cloud Vault locations in the event of a         cyber incident or a disaster recovery scenario.<\/p>","href":"saas\/rcv_loc_data_recovery.html","attributes":{"data-id":"rcv_loc_data_recovery"},"menu":{"hasChildren":false},"tocID":"rcv_loc_data_recovery-d22908e7240","topics":[]},{"title":"Rubrik Cloud Vault Notifications","shortdesc":"<p class=\"shortdesc\">Rubrik sends notifications to keep you informed about your storage capacity usage and         subscription status of your RCV locations. These notifications ensures that you can take         timely actions to maintain service availability and data protection.<\/p>","href":"saas\/rcv_notifications.html","attributes":{"data-id":"rcv_notifications"},"menu":{"hasChildren":false},"tocID":"rcv_notifications-d22908e7251","topics":[]}]}};